import AbstractFunctionOperand from "./abstract_function.operand";

export default class FracFunctionOperand extends AbstractFunctionOperand {
  constructor(operand) {
    super(operand);
  }

  getValue() {
    return 1 / this.operand.getValue();
  }

  getDesc() {
    return `Frac(${this.operand.getDesc()})`;
  }
}
